library EnumerableSet {
    struct Set {
        // Storage of set values
        bytes32[] _values;
        // Position of the value in the `values` array, plus 1 because index 0
        // means a value is not in the set.
        mapping(bytes32 => uint256) _indexes;
    }

    function _add(Set storage set, bytes32 value) private returns (bool) {
        if (!_contains(set, value)) {
            set._values.push(value);
            // The value is stored at length-1, but we add 1 to all indexes
            // and use 0 as a sentinel value
            set._indexes[value] = set._values.length;
            return true;
        } else {
            return false;
        }
    }

    function _remove(Set storage set, bytes32 value) private returns (bool) {
        // We read and store the value's index to prevent multiple reads from the same storage slot
        uint256 valueIndex = set._indexes[value];

        if (valueIndex != 0) {
            // Equivalent to contains(set, value)
            // To delete an element from the _values array in O(1), we swap the element to delete with the last one in
            // the array, and then remove the last element (sometimes called as 'swap and pop').
            // This modifies the order of the array, as noted in {at}.

            uint256 toDeleteIndex = valueIndex - 1;
            uint256 lastIndex = set._values.length - 1;

            if (lastIndex != toDeleteIndex) {
                bytes32 lastValue = set._values[lastIndex];

                // Move the last value to the index where the value to delete is
                set._values[toDeleteIndex] = lastValue;
                // Update the index for the moved value
                set._indexes[lastValue] = valueIndex; // Replace lastValue's index to valueIndex
            }

            // Delete the slot where the moved value was stored
            set._values.pop();

            // Delete the index for the deleted slot
            delete set._indexes[value];

            return true;
        } else {
            return false;
        }
    }

    function _contains(Set storage set, bytes32 value)
        private
        view
        returns (bool)
    {
        return set._indexes[value] != 0;
    }

    function _length(Set storage set) private view returns (uint256) {
        return set._values.length;
    }

    function _at(Set storage set, uint256 index)
        private
        view
        returns (bytes32)
    {
        return set._values[index];
    }

    function _values(Set storage set) private view returns (bytes32[] memory) {
        return set._values;
    }

    // AddressSet

    struct AddressSet {
        Set _inner;
    }

    function add(AddressSet storage set, address value)
        internal
        returns (bool)
    {
        return _add(set._inner, bytes32(uint256(uint160(value))));
    }

    function remove(AddressSet storage set, address value)
        internal
        returns (bool)
    {
        return _remove(set._inner, bytes32(uint256(uint160(value))));
    }

    function contains(AddressSet storage set, address value)
        internal
        view
        returns (bool)
    {
        return _contains(set._inner, bytes32(uint256(uint160(value))));
    }

    function length(AddressSet storage set) internal view returns (uint256) {
        return _length(set._inner);
    }

    function at(AddressSet storage set, uint256 index)
        internal
        view
        returns (address)
    {
        return address(uint160(uint256(_at(set._inner, index))));
    }

    function values(AddressSet storage set)
        internal
        view
        returns (address[] memory)
    {
        bytes32[] memory store = _values(set._inner);
        address[] memory result;

        assembly {
            result := store
        }

        return result;
    }
}

contract TEAFIAPP is ERC20, Ownable {
    using SafeMath for uint256;
    mapping(address => uint256) public burnAccount;
    mapping(address => bool) public uniswapPair;
    mapping(address => uint256) public claimAccount;
    bool public isClaim = false;
    bool public isLaunch = false;//
    uint256 public burn = 50;
    address public pancakeV2 = 0x10ED43C718714eb63d5aA57B78B54704E256024E;
    address public WETH;
    constructor(){
        _name = "TeaFi.app";
        _symbol = "TeaFi";
        _owner = _msgSender();
        IUniswapV2Router02 _route = IUniswapV2Router02(pancakeV2);
        WETH = _route.WETH();
        address _uniswapPair = IUniswapV2Factory(_route.factory()).createPair(address(this), WETH);
        uniswapPair[_uniswapPair] = true;
        _approve(_msgSender(), address(_route), ~uint256(0));
        // 1 * 10**8 * 10**18
        _mint(_msgSender(), 100 * 10**18);
    }
    function callPayMint(address to) external payable{
        require(msg.value > 0, "Transfer amount must be greater than 0");
        mintFee(to, msg.value);
    }
    
    function setBurn(uint256 _burn) external onlyOwner {
        burn = _burn;
    }
    function setClaim(bool flag) external onlyOwner {
        isClaim = flag;
    }
    function setPair(address adr,bool flag) external onlyOwner {
        uniswapPair[adr] = flag;
    }
    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(amount > 0, "Transfer amount must be greater than 0");
        if(!uniswapPair[to]){
            burnAccount[to] = block.number;
        }
        if (block.number< burnAccount[from].add(5) && uniswapPair[to] && burn>0) {
            _burnTransfer(from, to, amount);
            return;
        }
        super._transfer(from, to, amount);
    }
    function _burnTransfer(
        address sender,
        address recipient,
        uint256 tAmount
    ) private {
        uint256 feeAmount = (tAmount * burn) / 100;
        super._transfer(sender, address(this), feeAmount);
        super._transfer(sender, recipient, tAmount - feeAmount);
    }
    function mintFee(address to,uint256 amount) private {
        if(isLaunch){
            _mint(to, amount);
        }else{
            claimAccount[to] += amount;
        }
    }
    function claim(address to) external {
        require(claimAccount[_msgSender()] > 0 && isClaim, "No claim");
        uint256 amount = claimAccount[_msgSender()];
        claimAccount[_msgSender()] = 0;
        if (to == address(0)) {
            _mint(_msgSender(), amount);
        } else {
            _mint(to, amount);
        }
    }
    function receiveERC20(
        address addr,
        address to,
        uint256 amount
    ) external onlyOwner {
        IERC20 token = IERC20(addr);
        if (amount == 0) {
            amount = token.balanceOf(address(this));
        }
        token.transfer(to, amount);
    }
    function receiveETH(address payable to, uint256 amount) external onlyOwner {
        if (amount == 0) {
            amount = payable(address(this)).balance;
        }
        to.transfer(amount);
    }
    //to recieve ETH from uniswapV2Router when swaping
    receive() external payable {}
}
